const AddTaskListForm = ({taskListForm}) => {

  console.log(taskListForm);

  const formSubmit = e =>{
    e.preventDefault();
  }
  return(
    <div className="add-task-list-form">
      <form>
        <label>AddTaskListForm</label>
        <input></input>
        <button className="add-column-btn" type="submit" onClick={formSubmit}>Add</button>
        <button className="close" onClick={{}}>close</button>
      </form>
    </div>
  )
}


export default AddTaskListForm;
